import React from "react";
import { BrowserRouter as Router } from "react-router-dom";
import { AuthProvider } from "./AuthProvider.jsx";
import RoutesHandler from "./RoutesHandler.jsx";

function App() {
  return (
    <Router>
      <AuthProvider>
        <RoutesHandler />
      </AuthProvider>
    </Router>
  );
}

export default App;
